 (5,'ret','erty','retyery','0000-00-00 00:00:00',0,'2005-12-04 21:49:14',0,11,1,1,'',1,'',NULL,NULL,0,NULL),
 (6,'Ломохов','Анатолий','Дмитриевич','0000-00-00 00:00:00',1,'2007-05-18 16:57:00',0,169,0,1,'',0,'033','authors/033.jpg','',1,'Анатолий Дмитриевич Ломохов – один из самых известных российских фотографов, неоднократный призер российских и зарубежных выставок, лауреат премии «Paparazzi Awards 2005” в номинации – «Главный «звездный» светский фотограф». В его объектив в свое время попадали  люди, не нуждающиеся в дополнительном представлении: Валентина Терешкова, Дмитрий Шостакович, Даниил Гранин, Дин Рид. Любое, даже вроде бы незначительное событие Анатолий способен превратить на пленке в феерию. Именно поэтому невысокого человека с пышными усами и цепким взглядом знают в лицо все столичные звезды, с ним сотрудничают и его фотографии  публикуют ведущие глянцевые издания России и многие общественно-политические СМИ. '),
