 (21,'Примак','Игорь','Евгеньевич','0000-00-00 00:00:00',1,'2007-05-18 16:59:17',0,194,0,1,'',0,'021','authors/021.jpg','',1,''),
 (22,'Зильбер','Михаил','Ефимович','0000-00-00 00:00:00',0,'2006-11-15 15:39:33',0,195,0,1,'',0,'020','authors/020.jpg','',1,'Родился в 1960году. Фотографией начал заниматься с 8-летнего возраста, когда мне подарили фотоаппарат Смена-8М, это был 1968 год. Профессионально пошёл работать с 17 лет прошёл все стадии от лаборанта до фотокора. Работая фотокором  журнала «Журналист» объездил пол страны, участвовал в событиях 91и 93 годов. Больше всего меня увлекает репортаж, люблю поймать в процессе съёмки портрет, уловить характер человека, его особенную черту. Увлекаюсь портретом в студии, когда работаешь с человеком, узнаёшь о нём много интересного, пытаешься это воплотить в портрет.\r\nC 1998 года сотрудничаю с Телеканалом НТВ, а с 2000 года фотограф пресс-службы Телекомпании НТВ.'),
