 (71,'Ռազմիկ Զոհրաբյանը չի հերքում տարաձայնությունները ՀՀԿ-ի եւ ԲՀԿ-ի միջեւ','','http://www.azatutyun.am/content/article/2277320.html','2011-01-15 00:00:00',3,'Հովհաննես Շողիկյան (Երեւան)','Հանրապետականը այս տարի մի փոքր ավելի ակտիվ է լինելու, քանի որ տարին նախընտրական է: Իշխող կուսակցության փոխնախագահ Ռազմիկ Զոհրաբյանը այդ մասին հայտարարեց շաբաթ օրը կայացած ասուլիսի ժամանակ:'),
 (72,'Հնդկաստանում 100-ից ավելի ուխտագնացներ են զոհվել հրմշտոցից','','http://www.azatutyun.am/archive/news/20110115/2031/2031.html?id=2277235','2011-01-15 00:00:00',3,'','Ուրբաթ երեկոյան ավելի քան 100 ուխտագնացներ զոհվել եւ շուրջ 40-ը վիրավորվել են Հնդկաստանի հարավում կրոնական փառատոնի ժամանակ:  Ըստ իշխանությունների` հրմշտոցը սկսվել է, երբ ուխտագնացները խուճապի մեջ են ընկել ճանապահատրանսպորտային պատահարի հետեւանքով:  Ամեն տարի անցկացվող երկամսյա փառատոնի ժամանակ միլիոնավոր ուխտագնացներ են ուղեւորվում դեպի Այյափփան հինդու աստվածության` Քերալա նահանգի հեռավոր լեռնային շրջանում գտնվող տաճարը:  Երեկվա արարողությամբ փառատոնը ավարտվել է:'),
 (73,'Հեղաշրջում Թունիսում ','','http://www.azatutyun.am/archive/news/20110115/2031/2031.html?id=2277129','2011-01-15 00:00:00',3,'','Թունիսում ժամանակավոր նախագահ դարձավ խորհրդարանի խոսնակ Ֆունեդ Մբազան։ Շաբաթ օրը այս որոշումը ընդունեց երկրի Սահմանադրական դատարանը, նշելով, որ ըստ Սահմանադրության` երկրի կառավարումն անցնելու է խորհրդարանի նախագահին, այլ ոչ թե վարչապետին։  60 օրից Թունիսում նախագահական ընտրություններ են անցկացվելու։  Ուրբաթ գիշերը Թունիսի արդեն նախկին նախագահ Զին Աբիդին բեն Ալին իր ընտանիքով փախել էր երկրից։ Նա ապաստանել է Սաուդյան Արաբիայում։  74-ամյա բեն Ալին 23 տարի կառավարում էր Թունիսը։ Նա ստիպված ...'),
 (74,'Ալիեւ. «Վստահ եմ, որ Ադրբեջանի բանակը ասելու է իր խոսքը Ղարաբաղյան կարգավորման մեջ»','','http://www.azatutyun.am/content/article/2277186.html','2011-01-15 00:00:00',3,'Արման Հովհաննիսյան (Երեւան)','«2010 թվականին մենք չկարողացանք առաջընթացի հասնել Լեռնային Ղարաբաղի հակամարտության կարգավորման գործում: Պատճառը մեկն է` հայկական կողմը, կարելի է ասել, փորձում է խափանել բանակցությունները», - հայտարարել է Ադրբեջանի նախագահը:'),
 (75,'Սեյրան Օհանյան. «Այսուհետ եւս անհանդուրժող կերպով ենք արձագանքելու ցանկացած օրինախախտման»','','http://www.azatutyun.am/content/article/2277080.html','2011-01-15 00:00:00',3,'','Պաշտպանության նախարարը այդ մասին հայտարարել է նախարարության իրավապահ մարմինների 2010 թվականի աշխատանքների ամփոփիչ խորհրդակցության ժամանակ:'),
 (76,'Վաշինգտոնում ԱՄՆ-ի  նախագահն ու փոխնախագահը հանդիպել են Վրաստանի նախագահի հետ','','http://www.azatutyun.am/archive/news/20110115/2031/2031.html?id=2277047','2011-01-15 00:00:00',3,'','Սպիտակ տան մամուլի հաղորդագրությունը տեղեկացնում է, որ ԱՄՆ-ի նախագահ Բարաք Օբաման եւ փոխնախագահ Ջո Բայդենը հանդիպել են Վրաստանի նախագահ Միխեիլ Սահակաշվիլիի հետ։  Քննարկվել են Վրաստանի ջանքերը` ուղղված տնտեսական զարգացմանն ու առեւտրի ընդլյանմանը։  Հաղորդագրությունում նշված է, որ քննարկվել են նաեւ «անվտանգության մարտահրավերները Կովկասում» ու Աֆղանստանում միջազգային ուժերի աշխատանքը, որտեղ Վրաստանը 925 զինծառայող ունի։  Ուրբաթ օրը Վաշինգտոնում արարողություն է անցկացվել` նվիրված անցած ...'),
 (77,'Հունվարի 15-ի մամուլ','','http://www.azatutyun.am/content/article/2277048.html','2011-01-15 00:00:00',3,'Աղասի Ենոքյան (Երեւան)','«Չորրորդ ինքնիշխանություն»-ը գրում է. - «Նախօրեին Freedom House հեղինակավոր կազմակերպությունը հրապարակեց «Ազատություն աշխարհում» տարեկան զեկույցը, որտեղ առաջին անգամ Ղարաբաղը դասվել է անազատ քաղաքական եւ քաղաքացիական ազատություններ ունեցող երկրների շարքում, ինչպես` Ադրբեջանը: Այս փոփոխությունը, բնականաբար, Լեռնային Ղարաբաղի հակամարտության կարգավորման շուրջ ընթացող բանակցությունների վրա չի կարող իր անդրադարձը չունենալ: Հայաստանն ու Լեռնային Ղարաբաղը այսպիսով կորցրել են ...'),
 (78,'Սուդանում անկախության հանրաքվեն կայացել է','','http://www.azatutyun.am/archive/news/20110115/2031/2031.html?id=2277023','2011-01-15 00:00:00',3,'','Սուդանի հարավային շրջանի անկախության հարցով հանրաքվեն ավարտվում է. հունվարի 15-ը մեկ շաբաթ տեւած քվեարկության վերջին օրն է:  Պաշտոնական տվյալներով` 3.9 միլիոն գրանցված ընտրողներից քվեարկությանը արդեն մասնակցել է 60 տոկոսը, ինչը նշանակում է, որ հանրաքվեն կայացած է։  Հանրաքվեի արդյունքում հարավային շրջանը կարող է անջատվել Սուդանից եւ անկախ պետություն դառնալ։   Սուդանի իշխող կուսակցությունը ուրբաթ օրը հայտարարել է, որ պատրաստ է ընդունել Հարավային Սուդանի անկախությունը, բայց սահմանների ու նավթի ...'),
 (79,'Դավութօղլու. «Կարսի հուշարձանի մասին Էրդողանի հայտարարությունը քաղաքական ենթատեքստ չունի»','','http://www.azatutyun.am/archive/news/20110115/2031/2031.html?id=2277001','2011-01-15 00:00:00',3,'','Կարսում հայ - թուրքական բարեկամությունը խորհրդանշող հուշարձանի ապամոնտաժումը Թուրքիայի ներքին հարցն է եւ չի առնչվում Հայաստանի հետ հարաբերություններին: Այդ մասին հայտարարել է Թուրքիայի արտգործնախարար Ահմեդ Դավութօղլուն:  «Թուրքիայի վարչապետ Ռեջեփ Էրդողանի  հայտարարությունները  այն մասին, որ հուշարձանը պետք է ապամոնտաժվի, արվել են բացառապես գեղագիտական մղումներով, չկա որեւէ քաղաքական ենթատեքստ», - Դավութօղլուի խոսքերն են փոխանցում ադրբեջանական լրատվամիջոցները` վկայակոչելով թուրքական ...'),
 (80,'Russia To Host Fresh Armenian-Azeri Talks','','http://www.azatutyun.am/content/article/2276675.html','2011-01-14 00:00:00',3,'Tigran Avetisian (Yerevan)','Russian Foreign Minister Sergei Lavrov will host more negotiations between his Armenian and Azerbaijani counterparts in Moscow on January 24 as part of continuing international efforts to end the Nagorno-Karabakh conflict.'),
 (81,'Authorities Still Sanguine About Armenian Debt Burden','','http://www.azatutyun.am/content/article/2276669.html','2011-01-14 00:00:00',3,'Sargis Harutyunyan (Yerevan)','The Armenian authorities appear to remain confident about their ability to manage the country’s external debt that has more than doubled since the onset of the global financial crisis.'),
 (82,'Armenia Chides Turkish Leader Over ‘Friendship’ Statue Row','','http://www.azatutyun.am/content/article/2276664.html','2011-01-14 00:00:00',3,'Tigran Avetisian (Yerevan)','Armenia criticized Turkey’s government on Friday for planning to tear down a giant monument meant to promote reconciliation between the two estranged nations, saying that could further complicate the normalization of bilateral ties.'),
 (83,'Owner Vows To Fight On Against TV Closure','','http://www.azatutyun.am/content/article/2276660.html','2011-01-14 00:00:00',3,'Hovannes Shoghikian (Yerevan)','Tigran Karapetian, an Armenian politician and television host, seemed on Friday resigned to the controversial closure of his ALM channel, while pledging to stage more street protests against what called a “malicious decision” taken by broadcast authorities.'),
 (84,'Press Review','','http://www.azatutyun.am/content/article/2276657.html','2011-01-14 00:00:00',3,'','“Zhamanak” suggests that Armenia’s leadership will be contesting the 2012 parliamentary elections and possibly the presidential election of 2013 “in a fairly broad-based coalition with numerous figures.”'),
 (85,'«Մոլորակ» հանդես. աշխարհի անցուդարձը','','http://www.azatutyun.am/content/article/2276637.html','2011-01-14 00:00:00',3,'Ազա Բաբայան (Մոսկվա), Աստղիկ Բեդեւյան (Պրահա), Տաթեւիկ Լազարյան (Երեւան), Արմեն Քոլոյան (Պրահա)','Հանդեսի այս թողարկումը անդրադառնում է Եվրամիության բարձրաստիճան պաշտոնյաների եւ Ադրբեջանի ղեկավարության` երեկ Բաքվում կայացած բանակցություններին, ռուս-վրացական հարաբերություններում վերջին զարգացումներին եւ Ղազախստանի նախագահի լիազորությունները երկարաձգելու հարցով հանրաքվեին:'),
 (86,'ԱԱԾ օպերլիազորը սուտ մատնություն է կազմակերպել','','http://www.azatutyun.am/archive/news/20110114/2031/2031.html?id=2276524','2011-01-14 00:00:00',3,'','Ազգային անվտանգության ծառայության Էջմիածնի բաժնի աշխատակցին մեղադրանք է առաջադրվել պաշտոնական լիազորությունները չարաշահելու եւ սուտ մատնության համար: Այս մասին հայտնում է Հայաստանի հատուկ քննչական ծառայությունը:   ԱԱԾ Արմավիրի մարզային վարչության Էջմիածնի բաժնի ավագ օպերլիազոր Արայիկ Անտոնյանը, չարաշահելով իր պաշտոնական լիազորությունները, Էջմիածնի բնակչուհի Մ.-ին դրդել է Գ. Մկրտչյանի նկատմամբ ծանր հանցագործության մեջ սուտ մատնություն կատարել` միաժամանակ ստեղծելով մեղադրանքի արհեստական ...'),
 (87,'Լրանում է Երեւանի պատմության թանգարանի հիմնադրման 80 տարին','','http://www.azatutyun.am/content/article/2276480.html','2011-01-14 00:00:00',3,'Գայանե Դանիելյան (Երեւան)','Այս տարի լրանում է Երեւանի պատմության թանգարանի հիմնադրման 80-ամյակը:'),
 (88,'Դատապարտյալը ինքնասպանություն է գործել','','http://www.azatutyun.am/archive/news/20110114/2031/2031.html?id=2276412','2011-01-14 00:00:00',3,'','Հայաստանի արդարադատության նախարարության «Վարդաշեն» քրեակատարողական հիմնարկում հինգշաբթի օրը` հունվարի 13-ին, ժամը 19:45-ի սահմաններում կախվելու միջոցով ինքնասպան է եղել դատապարտյալ Վահրամ Հովհաննիսյանը:  Քրեակատարողական վարչության հասարակայնության հետ կապերի վարչությունը տեղեկացնում է նաեւ, որ 13 տարվա ազատազրկման դատապարտված Վահրամ Հովհաննիսյանը (ծնվ. 1983 թ), կրել էր պատժի 8 տարին:  Դեպքի առթիվ կատարվում է նախաքննություն:'),
 (89,'Եղեգնուտցիները բողոքում են գյուղապետի անօրինականությունների դեմ','','http://www.azatutyun.am/content/article/2276437.html','2011-01-14 00:00:00',3,'Հասմիկ Սմբատյան (Երեւան)','Արմավիրի մարզի Եղեգնուտ գյուղի բնակիչները ուրբաթ օրը նախագահական նստավայրի դիմաց պահանջում էին իրենց գյուղապետի հրաժարականը:'),
 (90,'Նախկին վարչապետը 3-4 տարի հետո «դեֆոլտ» է կանխատեսում','','http://www.azatutyun.am/content/article/2276383.html','2011-01-14 00:00:00',3,'Սարգիս Հարությունյան (Երեւան)','Հայաստանի նախկին վարչապետ Հրանտ Բագրատյանի ներկայացմամբ, Հանրապետության արտաքին պարտքի այժմյան մակարդակի պայմաններում 2013-14 թվականներին Հայաստանը ի զորու չի լինելու վճարել վարկային տոկոսները:'),
 (91,'ԼՂ-ում քննարկում են որոշակի խավերի բնակարանային պայմանները բարելավելու հարցը','','http://www.azatutyun.am/content/article/2276333.html','2011-01-14 00:00:00',3,'Լուսինե Մուսայելյան, Ստեփանակերտ (Ստեփանակերտ)','Լեռնային Ղարաբաղում քննարկումներ են բնակչության որոշակի խավերի բնակարանային պայմանների բարելավման ուղղությամբ:'),
 (92,'Ռուսաստանցի սպան եւ նրա մայրը մեղադրվում են Վրաստանի օգտին լրտեսության մեջ','','http://www.azatutyun.am/archive/news/20110114/2031/2031.html?id=2276275','2011-01-14 00:00:00',3,'','Վրաստանի օգտին լրտեսության միջոցով պետական դավաճանության կասկածանքով ձերբակալվել են ռուսաստանցի մի զինծառայող եւ նրա մայրը:  Ինչպես ԻՏԱՌ-ՏԱՍՍ լրատվական գործակալությանը հայտնել են Ռուսաստանի Անվտանգության դաշնային ծառայությունից (ԱԴԾ), Հարավային զինվորական օկրուգի զորամասերից մեկի զինծառայող, ավագ լեյտենանտ Դավիդ Ալիեւին եւ նրա մորը` Իրինա Ալիեւային մեղադրանք է առաջադրվել, եւ նրանց նկատմամբ խափանման միջոց է ընտրվել կալանքը:  Ըստ ԱԴԾ-ի` Ալիեւը վրացական հատուկ ծառայությունների հանձնարարությամբ ...'),
 (93,'ԱԼՄ հեռուստաընկերության աշխատակիցները դատական հայց են պատրաստում','','http://www.azatutyun.am/content/article/2276219.html','2011-01-14 00:00:00',3,'Հովհաննես Շողիկյան (Երեւան)','ԱԼՄ հեռուստաընկերության աշխատակիցները պատրաստվում են դատական հայց ներկայացնել ընդդեմ Հեռուստատեսության եւ ռադիոյի ազգային հանձնաժողովի (ՀՌԱՀ):'),
 (94,'Ղազախստանի խորհրդարանը պնդում է Նազարբաեւի պաշտոնավարումը երկարաձգելու հանրաքվեի անցկացումը','','http://www.azatutyun.am/archive/news/20110114/2031/2031.html?id=2276165','2011-01-14 00:00:00',3,'','Ղազախստանի խորհրդարանի զույգ պալատների համատեղ նիստում այսօր միաձայն որոշում է ընդունվել համապատասխան փոփոխություն կատարել Սահմանադրությունում, որը թույլ կտա երկրի նախագահ Նուրսուլթան Նազարբաեւի պաշտոնավարման ժամկետը մինչեւ 2020 թվականը երկարաձգելու հարցով հանրաքվե անցկացնել:  70-ամյա Նազարբաեւը Ղազախստանը ղեկավարում է արդեն ավելի քան երկու տասնամյակ: Պաշտոնավարման ժամկետի երկարաձգումը նրան թույլ կտա շրջանցել 2012 թվականին նախատեսված ընտրությունները:  Նազարբաեւը մեկ շաբաթ առաջ  մերժել էր  տվյալ ...'),
 (95,'Հայաստանյան քաղաքական ուժերը մեկնաբանում են Freedom House-ի գնահատականը Ղարաբաղի վերաբերյալ','','http://www.azatutyun.am/content/article/2276176.html','2011-01-14 00:00:00',3,'Իրինա Հովհաննիսյան (Երեւան)','Լեռնային Ղարաբաղի մասին Freedom House միջազգային հեղինակավոր կազմակերպության գնահատականները Հայաստանի իշխող Հանրապետական կուսակցության փոխնախագահ Ռազմիկ Զոհրաբյանը որակում է որպես ճնշում ղարաբաղյան բանակցությունների վրա` հայկական կողմից զիջումներ կորզելու նպատակով:'),
 (96,'Անցած տարի Հյուսիսային Կովկասում սպանվել Է 319 զինյալ եւ 124 զինծառայող','','http://www.azatutyun.am/archive/news/20110114/2031/2031.html?id=2276120','2011-01-14 00:00:00',3,'','«Կովկասյան հանգույց» կայքը հրապարակել է 2010 թվականի ընթացքում Հյուսիսային Կովկասում մարտական գործողությունների ընթացքում մարդկային կորուստների մանրամասն վիճակագրությունը, որի համաձայն, ահաբեկչական գրոհների եւ հակաահաբեկչական գործողությունների ընթացքում Դաղստանում, Չեչնիայում եւ Կաբարդինո-Բալկարիայում ընդհանուր հաշվով սպանվել է 319 զինյալ։  32 գործողություններից 22-ը իրականացվել է Դաղստանում, որտեղ զոհվել է ոստիկանության եւ անվտանգության ուժերի 124 զինծառայող եւ 176 զինյալ ապստամբ։ ...'),
 (97,'Էդվարդ Նալբանդյան. «Ադրբեջանցիները իրենք չեն հասկանում, թե ինչ են ուզում ասել»','','http://www.azatutyun.am/content/article/2276136.html','2011-01-14 00:00:00',3,'Տիգրան Ավետիսյան (Երեւան)','Հայաստանի արտգործնախարար Էդվարդ Նալբանդյանը ուրբաթ օրը հաստատեց, որ հունվարի 24-ին Մոսկվայում հանդիպելու են Հայաստանի, Ադրբեջանի եւ Ռուսաստանի արտգործնախարարները:'),
 (98,'Բրազիլիայում ջրհեղեղների եւ սողանքների զոհերի թիվը մոտենում է 500-ին','','http://www.azatutyun.am/archive/news/20110114/2031/2031.html?id=2276095','2011-01-14 00:00:00',3,'','Բրազիլիայում ջրհեղեղների եւ սողանքների հետեւանքով զոհվածների թիվը մոտենում է 500-ին:  Երեկվա դրությամբ հաստատվել է ավելի քան 480 մարդու զոհվելու փաստը Ռիո դե Ժանեյրոյից հյուսիս գտնվող Սերանա տարածաշրջանում, եւ մտավախություն կա, որ այդ թիվը կավելանա, երբ փրկարարները հասնեն ճանապարհների եւ կամուրջների փլուզման հետեւանքով մեկուսացման մեջ հայտնված շրջաններ:  Ավելի քան 200 մարդ զոհվել է մեկ քաղաքում` Տերեսոպոլիսում:  Աղետի գոտի է այցելել Բրազիլիայի նորընտիր նախագահ Դիլմա Ռուսեֆը, ով տեղի ունեցածը ...'),
 (99,'Հայերեն զգուշացնող գրություններ Գլենդեյլի փողոցներում','','http://www.azatutyun.am/content/article/2276040.html','2011-01-14 00:00:00',3,'Տաթեւիկ Լազարյան (Երեւան)','Պակասեցնելու համար հետիոտների մասնակցությամբ ճանապարհատրանսպորտային պատահարների թիվը` Գլենդեյլի իշխանությունները նոր զգուշացնող գրություններ են տեղադրում խաչմերուկներում: Այդ զգուշացումը գրված է երեք լեզուներով` այդ թվում եւ հայերեն:'),
 (100,'Սերժ Սարգսյանը պետական այցեր կկատարի Կիպրոս եւ Հունաստան','','http://www.azatutyun.am/archive/news/20110114/2031/2031.html?id=2275984','2011-01-14 00:00:00',3,'','Հայաստանի նախագահ Սերժ Սարգսյանը հունվարի 17-ին պետական այցով կմեկնի Կիպրոսի: Հունվարի 18-ին կմեկնարկի Սերժ Սարգսյանի պետական այցը Հունաստան:  Հայաստանի նախագահի մամլո գրասենյակի փոխանցմամբ` Կիպրոս այցի շրջանակներում Սերժ Սարգսյանը հանդիպումներ կունենա երկրի նախագահ Դիմիտրիս Խրիստոֆիասի, արքեպիսկոպոս Խրիսոստոմոս երկրորդի, Ներկայացուցիչների պալատի նախագահ Մարիոս Գարոյանի, տեղի հայկական համայնքի ներկայացուցիչների հետ, կմասնակցի հայ - կիպրական գործարար համաժողովի բացմանը:  Այցի վերջին օրը` ...'),
 (101,'Եվրամիությունը եւ Ադրբեջանը գազի փոխադրման պայմանագիր կնքեցին','','http://www.azatutyun.am/content/article/2275887.html','2011-01-14 00:00:00',3,'Արմեն Քոլոյան (Պրահա)','Հինգշաբթի օրը Ադրբեջանի մայրաքաղաք Բաքու են ժամանել Եվրահանձնաժողովի նախագահ Ժոզե Մանուել Բարոզուն եւ Եվրամիության էներգետիկայի հարցերով հանձնակատար Գյունտեր Օտինգերը: Այցի օրակարգում Եվրամիության երկրներ գազի առաքման խնդիրներն են։'),
 (102,'ԱՄՆ-ը պատժամիջոցներ է կիրառում եւս 26 ընկերությունների նկատմամբ','','http://www.azatutyun.am/archive/news/20110114/2031/2031.html?id=2275855','2011-01-14 00:00:00',3,'','Միացյալ Նահանգները պատժամիջոցներ է կիրառել 26 ընկերությունների նկատմամբ, որոնք ենթադրաբար կապված են Իրանի միջուկային ծրագրի հետ:  ԱՄՆ-ի ֆինանսների նախարարության պնդմամբ` Սինգապուրում եւ Իռլանդական ծովում գտնվող Մեն կղզում տեղակայված ընկերությունները սերտ կապեր ունեն Իրանի նավագնացության ազգային ընկերության, ինչպես նաեւ պաշտպանության նախարարության կազմում գործող մի շարք արդյունաբերական ընկերությունների հետ:'),
 (103,'Փետրվարի առաջին կեսին սպասվում է Հիլարի Քլինթոնի այցը Անկարա','','http://www.azatutyun.am/archive/news/20110114/2031/2031.html?id=2275848','2011-01-14 00:00:00',3,'','Թուրքիայի արտգործնախարարությունը հայտարարել է, թե փետրվարի առաջին կեսին սպասվում է Միացյալ Նահանգների պետքարտուղար Հիլարի Քլինթոնի այցը Անկարա:  CNN Turk-ի փոխանցմամբ` Քլինթոնը կհանդիպի Թուրքիայի նախագահ Աբդուլա Գյուլի, վարչապետ Ռեջեփ Էրդողանի եւ արտգործնախարար Ահմեդ Դավութօղլուի հետ:  Այցի առանցքային թեմաներն են լինելու հայ - թուրքական հարաբերությունները, Իրանի միջուկային ծրագիրը, Մերձավոր Արեւելքում խաղաղության հաստատման խնդիրը:'),
 (104,'Բաքվում ստորագրվեց Հարավային գազային միջանցքի հռչակագիրը','','http://www.azatutyun.am/archive/news/20110114/2031/2031.html?id=2275844','2011-01-14 00:00:00',3,'','Ադրբեջանը պարտավորվել է դեպի Եվրոպա գազի երկարաժամկետ մատակարարումներ ապահովել:  «Հարավային գազային միջանցք» կոչվող նախագծի վերաբերյալ համատեղ հռչակագիրը հինգշաբթի երեկոյան Բաքվում ստորագրել են Եվրահանձնաժողովի նախագահ Ժոզե Մանուել Բարոզուն եւ Ադրբեջանի նախագահ Իլհամ Ալիեւը:  Գազի մատակարարումների ծավալը եւ պայմանագրի այլ մանրամասներ դեռ հայտնի չեն:  «Հարավային գազային միջանցք» նախագիծը ենթադրում է Ռուսաստանը շրջանցող գազատարների ցանցի կառուցում, որը թույլ կտա զգալիորեն ...'),
 (105,'Հունվարի 14-ի մամուլ','','http://www.azatutyun.am/content/article/2275827.html','2011-01-14 00:00:00',3,'Ռուբեն Մելոյան (Երեւան)','Ընդդիմադիր գործիչ Գուրգեն Եղիազարյանը «Առավոտ»-ի հետ զրույցում ասում է. - «Ըստ իմ ունեցած տեղեկությունների, այսօր իշխանության մեջ գտնվող մարդիկ պարբերաբար հանդիպում են Ռոբերտ Քոչարյանին` խնդրելով, որ նա վերադառնա»:'),
 (106,'Ղարաբաղում համաձայն չեն Freedom House-ի գնահատականի հետ','','http://www.azatutyun.am/content/article/2275694.html','2011-01-14 00:00:00',3,'Լուսինե Մուսայելյան, Ստեփանակերտ (Ստեփանակերտ)','Freedom House միջազգային հեղինակավոր կազմակերպության` հինգշաբթի օրը հրապարակած տարեկան զեկույցում Լեռնային Ղարաբաղի մասով հետընթաց է գրանցվել։'),
 (107,'World Bank Sees Faster Growth In Armenia ','','http://www.azatutyun.am/content/article/2275606.html','2011-01-13 00:00:00',3,'Hovannes Shoghikian (Yerevan), Ruben Meloyan (Yerevan)','Economic growth in Armenia will reach to 4.6 percent this year and accelerate to almost 5 percent in 2012, the World Bank said in its annual global economic report released on Thursday.'),
 (108,'Armenia Remains Opposed To PACE Panel On Karabakh','','http://www.azatutyun.am/content/article/2275601.html','2011-01-13 00:00:00',3,'Tigran Avetisian (Yerevan)','Armenia remains strongly opposed to renewed discussions on the Nagorno-Karabakh conflict at the Council of Europe Parliamentary Assembly (PACE) that are championed by its current, Turkish president, a senior Armenian lawmaker said on Thursday.'),
 (109,'Young Lawyer Named New Chief Military Prosecutor','','http://www.azatutyun.am/content/article/2275600.html','2011-01-13 00:00:00',3,'','A 33-year-old legal assistant to President Serzh Sarkisian was appointed as Armenia’s new chief military prosecutor and introduced to his subordinates on Thursday.'),
 (110,'Press Review','','http://www.azatutyun.am/content/article/2275596.html','2011-01-13 00:00:00',3,'','Arman Grigorian, the HAK’s representative to the Council of Europe’s Parliamentary Assembly (PACE), assures “Haykakan Zhamanak” that the release of “political prisoners” will likely continue in the coming months.'),
 (111,'ԵԱՀԿ-ի նոր նախագահողը ներկայացրեց իր առաջնահերթությունները','','http://www.azatutyun.am/content/article/2275940.html','2011-01-13 00:00:00',3,'Հրաչ Մելքումյան (Պրահա)','ԵԱՀԿ-ն նախագահելու ընթացքում Լիտվայի համար առաջնահերթություններն է ներկայացրել երկրի արտգործնախարարը հինգշաբթի օրը Վիեննայում կայացած ասուլիսում:'),
 (112,'Հայաստանը մնացել է «մասամբ ազատ» երկրների թվում','','http://www.azatutyun.am/content/article/2275542.html','2011-01-13 00:00:00',3,'Տաթեւիկ Լազարյան (Երեւան)','Հայաստանը Freedom House միջազգային հեղինակավոր կազմակերպության` այսօր հրապարակած տարեկան զեկույցում կրկին բնորոշվել է որպես «մասամբ ազատ երկիր»:'),
 (113,'Հովիկ Աբրահամյանը կշարունակի գլխավորել Տնտեսագիտական համալսարանի խորհուրդը ','','http://www.azatutyun.am/archive/news/20110113/2031/2031.html?id=2275497','2011-01-13 00:00:00',3,'','Հունվարի 13-ին կայացած Հայաստանի պետական տնտեսագիտական համալսարանի (ՀՊՏՀ) խորհրդի  նիստում Ազգային Ժողովի նախագահ Հովիկ Աբրահամյանը երկրորդ անգամ ընտրվել է համալսարանի խորհրդի նախագահ: Այս մասին հաղորդում է ԱԺ-ի հասարակության հետ կապերի բաժինը:   Կրթության եւ գիտության նախարար Արմեն Աշոտյանը նիստի սկզբում տեղեկացրել է, որ նիստի  օրակարգային առաջին հարցը  ՀՊՏՀ խորհրդի նախագահի ընտրությունն է, եւ դիմել խորհրդի  անդամներին` ներկայացնելու  թեկնածություններ:   ՀՊՏՀ-ի պրոռեկտոր Վարդան Սարգսյանը ...'),
 (114,'Հունվարի 13-ին հայերը նշում են հին Նոր տարին','','http://www.azatutyun.am/content/article/2275441.html','2011-01-13 00:00:00',3,'Գայանե Դանիելյան (Երեւան)','Հունվարի 13-ին շատ ժողովուրդներ, այդ թվում հայերը, ռուսներ եւ այլք նշում են հին Նոր տարին, որը նախկին` հուլյան օրացույցով համընկնում է հունվարի 1-ի հետ:'),
 (115,'Տիգրան Սարգսյանը 2011 թվականը «բացառիկ» տարի է որակում փոքր եւ միջին բիզնեսի զարգացման համար','','http://www.azatutyun.am/content/article/2275333.html','2011-01-13 00:00:00',3,'Հովհաննես Շողիկյան (Երեւան)','Կառավարությունը ֆինանսների նախարարության հետ 2010 թվականի բյուջեի կատարողականի նախնական ամփոփում է կատարել, այսօր գործադիրի այս տարվա առաջին նիստում ասաց վարչապետ Տիգրան Սարգսյանը:');
