 (116,'Կաղանդ պապն ամփոփեց Ձմեռային փառատոնը','','http://www.azatutyun.am/content/article/2275346.html','2011-01-13 00:00:00',3,'Նարինե Ղալեչյան (Երեւան)','Այսօր Երեւանում ամփոփվեց Ձմեռային փառատոն 2010-ը: Դեկտեմբերի 25-ից հունվարի 5-ը փառատոնը մայրաքաղաքը լցրել էր  ամենատարբեր միջոցառումներով` տոնական շքերթից մինչեւ բացօթյա համերգներ: Ձմեռային տոնակատարություններին այս տարի շուրջ 6500 մարդ է մասնակցել:'),
 (117,'Տավուշում երիտասարդի մահվան պատճառ դարձած նախկին հրամանատարին մեղադրանք է առաջադրվել','','http://www.azatutyun.am/content/article/2275270.html','2011-01-13 00:00:00',3,'Իրինա Հովհաննիսյան (Երեւան)','Պաշտպանության նախարարության մամուլի քարտուղար Դավիթ Կարապետյանը «Ազատություն» ռադիոկայանին փոխանցեց, որ Տավուշի մարզի N զորամասի նախկին հրամանատար Սերգեյ Կարապետյանին մեղադրանք է առաջադրվել Քրեական օրենսգրքի մի շարք հոդվածների հատկանիշներով:'),
 (118,'Հայկական կողմը «պետք է բոյկոտի» ԼՂ հարցով ենթահանձնաժողովի աշխատանքը','','http://www.azatutyun.am/content/article/2275309.html','2011-01-13 00:00:00',3,'Տիգրան Ավետիսյան (Երեւան)','Եվրախորհրդի խորհրդարանական վեհաժողովում (ԵԽԽՎ) հայաստանյան պատվիրակության անդամ Նաիրա Զոհրաբյանի համոզմամբ` հայկական պատվիրակությունը պետք է բոյկոտի վեհաժողովում Լեռնային Ղարաբաղի հարցով ենթահանձնաժողովի աշխատանքները` եթե վերջինս վերականգնվի:'),
 (119,'ԱԺ ֆինանսավարկային հանձնաժողովի նախագահը կոռուպցիայի դեմ «հետեւողական» պայքար է կանխատեսում','','http://www.azatutyun.am/content/article/2275231.html','2011-01-13 00:00:00',3,'Ռուբեն Մելոյան (Երեւան)','Ազգային ժողովի ֆինանսավարկային եւ բյուջետային մշտական հանձնաժողովի նախագահ Գագիկ Մինասյանի կարծիքով, 2010 թվականը առաջին հետճգնաժամային տարին էր, եւ պետության կողմից իրականացված լուրջ միջոցառումների արդյունքում տնտեսության մեջ դրական միտումներ եղան. տնտեսության աճը գրեթե երկու անգամ գերազանցեց բյուջեով նախատեսված ցուցանիշը, թեեւ նույնքան էլ բարձր էր գնաճը:'),
 (120,'2011-ը` երկվորյակի տարի. բարդ է լինելու','','http://www.azatutyun.am/content/article/2275214.html','2011-01-13 00:00:00',3,'Լիանա Մնացականյան (Երեւան)','Ըստ աստղաբան Գուրգեն Հովհաննիսյանի` դարեր առաջ հայերն առաջնորդվել են սրբազան  հին  տոմարով, որը  հիմնված է անշարժ արեգակնային տոնացույցի վրա: Հայաձայն դրա` նոր տարին նշվել է արեգ ամսվա արեգ օրը`մարտի 21-ին, ըստ այդմ` հայերը 2011-ը պետք է ոչ թե ճագարի տարի համարեն, այլ երկվորյակի:'),
