 (1,'template1','Subject form for $companyName','Hi $firstname $surname!\\nDo you like $technology?\\n$currentTime\\nGood luck!','TEXT_PLAIN'),
 (2,'.ru.psfotos.registerUser.ENABLED','Welcome $firstname $surname to personastars','Hi $firstname $surname!\r\nNow you can login to http://www.personastars.com:8080/photobank\r\n\r\nВсем привет!\r\nԲոլոր բարեւ!','TEXT_PLAIN'),
 (3,'.ru.psfotos.registerUser.DISABLED','Reject from personastars for $firstname $surname ','Hi $firstname $surname !\r\nSorry for your profile\'s suspicious','TEXT_PLAIN'),
 (4,'.ru.psfotos.restoreUserPassword','Password restoration for $firstname $surname.','Hi $firstname $surname !\r\n\r\nHere is your new password $newpassword.\r\n\r\nYou can change it if you wish in your profile.','TEXT_PLAIN'),
 (5,'.ru.psfotos.approveOrder','Подтверждение заказа № $order.id','Здравствуйте $firstname $surname !\r\n\r\nНиже находятся ссылки на файлы, входящие в заказ # $order.id.\r\nДля скачки файлов необходимо аутентифицироваться.\r\n\r\n#foreach($orderItem in $order.items)\r\n   $downloadLink$orderItem.id\r\n#end\r\n\r\n\r\n\r\nУдачи!','TEXT_PLAIN'),
 (6,'.ru.psfotos.rejectOrder','Order # $order.id reject','Hi $firstname $surname !\r\n\r\nYour order # $order.id rejected:\r\n\r\n#foreach($orderItem in $order.items)\r\n   $orderItem.file.fileName (order id: $orderItem.id, file id: $orderItem.file.id)\r\n#end\r\n\r\nGood luck!','TEXT_PLAIN');
