INSERT INTO `site_log_queries` (`site_log_query_id`,`query`,`_active`,`_order`,`description`) VALUES 
 (1,'SELECT\r\n CONCAT(\'<a href=\"./?q=siteusers&suid=\',su.id,\'\" target=\"com.personastars.users\">\',su.name,\'</a>\') AS \"пользователь\",\r\n su.organization AS \"организация\",\r\n sua.modification_time AS \"дата изменения\",\r\n/*\r\n  IFNULL(sua.remote_addr,\r\n    SUBSTRING(SUBSTRING(sua.comments ,POSITION(\'/\' IN sua.comments)+1),POSITION(\'/\' IN SUBSTRING(sua.comments ,POSITION(\'/\' IN sua.comments)+1))+1)\r\n  )\r\n  as \'IP пользователя\',\r\n*/\r\n remote_addr as \'ip\',\r\n case sua.id_action when 1 then \'вход\' else \'выход\' end AS \"действие\",\r\n case sua.id_result\r\n   when 1\r\n    then \'<span style=\"color:#555500;\">успешный</span>\'\r\n    else \'<span style=\"color: #ee0000;\">ошибка</span>\'\r\n   end AS \"результат\",\r\n case  when ((substring(action_value,1,4)=\'asd/\') or (substring(action_value,1,6)=\'sergo/\')) then \'???\' else action_value end as `доп.параметры`\r\nFROM\r\n site_users_actions sua\r\n LEFT JOIN site_users su ON sua.id_site_user=su.id\r\nWHERE\r\n sua.id_action IN (1,2)\r\nORDER BY\r\n sua.modification_time DESC\r\nLIMIT\r\n 350',1,0,'входы пользователей'),
 (2,'select\r\n	case weekday(modification_time)\r\n			when 0 then \'<font style=\"color: #ffaa11\">Понедельник</font>\'\r\n			when 1 then \'Вторник\'\r\n			when 2 then \'Среда\'\r\n			when 3 then \'Четверг\'\r\n			when 4 then \'Пятница\'\r\n			when 5 then \'<font style=\"color: #ff5555\">Суббота</font>\'\r\n			when 6 then \'<font style=\"color: #ff1111\">Воскресенье</font>\'\r\n		end as \'День недели\',\r\n	count(distinct id_site_user) as \'Уникальных входов\',\r\n	count(id_site_user)/count(distinct id_site_user) as \'Входов на пользвоателя\',\r\n	concat(year(modification_time),\'.\',month(modification_time),\'.\',DAYOFMONTH(modification_time)) as date_grouped\r\nfrom site_users_actions\r\nwhere id_result=1 and id_action=1\r\ngroup by date_grouped\r\norder by modification_time desc',1,80,'статистика входов'),
 (3,'select\r\n concat(year(f.modification_time),\'.\',month(f.modification_time)) as mmm,\r\n c.description as \"категория\",\r\n count(*) as n\r\nfrom _photobank_categories c\r\n inner join _photobank_files f on f.id_category=c.id\r\ngroup by mmm,c.description\r\norder by\r\n mmm desc,\r\n n desc',1,150,'количество файлов в категориях'),
 (4,'select\r\n count(*) as \'полное количество файлов\',\r\n sum(case when id_news>0 then 1 else 0 end) as \'новостных файлов\'\r\nfrom\r\n _photobank_files where _active=1',1,160,'количество файлов всего'),
 (5,'select\r\n	case weekday(modification_time)\r\n			when 0 then \'<font style=\"color: #ffaa11\">Понедельник</font>\'\r\n			when 1 then \'Вторник\'\r\n			when 2 then \'Среда\'\r\n			when 3 then \'Четверг\'\r\n			when 4 then \'Пятница\'\r\n			when 5 then \'<font style=\"color: #ff5555\">Суббота</font>\'\r\n			when 6 then \'<font style=\"color: #ff1111\">Воскресенье</font>\'\r\n		end as \'День недели\',\r\n	count(distinct id_site_user) as \'Уникальных входов\',\r\n	count(id_site_user)/count(distinct id_site_user) as \'Входов на пользвоателя\',\r\n	concat(year(modification_time),\'.\',month(modification_time),\'.\',DAYOFMONTH(modification_time)) as date_grouped\r\nfrom site_users_actions\r\nwhere id_result=1 and id_action=1\r\ngroup by date_grouped\r\norder by modification_time desc',1,11111,'Посещения зарегистрированных пользователей'),
 (6,'SELECT\r\n	count(*) as the_number_of_visits,\r\n	site_actions.site_action_id,\r\n	site_actions.site_action_description,\r\n                CASE IFNULL(site_users_actions.id_site_user,-1)\r\n                      WHEN -1 then\r\n                         CONCAT(\'<small style=\"background-color: #eeeeee;\">\',site_users_actions.remote_addr,\'<br/><span style=\"color: #a8a8a8;\">[\',site_users_actions.http_user_agent,\']</span></small>\')\r\n                      ELSE\r\n                         concat(\'<a href=\"./?q=siteusers&suid=\',site_users.id,\'\" target=\"photobank_users\" style=\"color: #fe0000;\">[\',site_users.id,\'] \',site_users.name,\' (\',site_users.organization,\')\',\'</a>\')\r\n                      END\r\n                 AS site_user_link,\r\n	concat(\'<a href=\"./?categid=\',_photobank_categories.id,\'\" target=\"photobank_categories\">\',_photobank_categories.description,\'</a>\') as category_link,\r\n	DATE(concat(year(site_users_actions.modification_time),\'.\',month(site_users_actions.modification_time),\'.\',day(site_users_actions.modification_time))) as date_grouped\r\nFROM\r\n	site_users_actions\r\n	Inner Join site_actions ON site_actions.site_action_id = site_users_actions.id_action\r\n	Left Join site_users ON site_users.id NOT IN (2) AND site_users.id = site_users_actions.id_site_user\r\n	Inner Join _photobank_categories ON _photobank_categories.id = site_users_actions.action_value\r\nGROUP BY\r\n	site_actions.site_action_id,\r\n	site_actions.site_action_description,\r\n	site_user_link,\r\n	category_link,\r\n	date_grouped\r\nORDER BY\r\n	date_grouped DESC,\r\n	the_number_of_visits DESC\r\nLIMIT 250',1,90,'Статистика посещений категорий пользователями (групп. по дням)'),
 (7,'SELECT\r\n	count(*) as the_number_of_visits,\r\n	site_actions.site_action_id,\r\n	site_actions.site_action_description,\r\n	concat(\'<a href=\"./?categid=\',_photobank_categories.id,\'\" target=\"photobank_categories\">\',_photobank_categories.description,\'</a>\') as category_link,\r\n	DATE(concat(year(site_users_actions.modification_time),\'.\',month(site_users_actions.modification_time),\'.1\')) as date_grouped\r\nFROM\r\n	site_users_actions\r\n	Inner Join site_actions ON site_actions.site_action_id = site_users_actions.id_action\r\n	Inner Join site_users ON site_users.id NOT IN (2) AND site_users.id = site_users_actions.id_site_user\r\n	Inner Join _photobank_categories ON _photobank_categories.id = site_users_actions.action_value\r\nGROUP BY\r\n	site_actions.site_action_id,\r\n	site_actions.site_action_description,\r\n	category_link,\r\n	date_grouped\r\nORDER BY\r\n	date_grouped DESC,\r\n	the_number_of_visits DESC\r\nLIMIT 250',1,100,'Статистика посещений категорий (зарег. пользоват-ми, групп. по мес.)'),
 (8,'SELECT\r\n	count(*) as the_number_of_visits,\r\n	site_actions.site_action_id,\r\n	site_actions.site_action_description,\r\n                CASE IFNULL(site_users_actions.id_site_user,-1)\r\n                      WHEN -1 then\r\n                         CONCAT(\'<small style=\"background-color: #eeeeee;\">\',site_users_actions.remote_addr,\'<br/><span style=\"color: #a8a8a8\">[\',site_users_actions.http_user_agent,\']</span></small>\')\r\n                      ELSE\r\n                         concat(\'<a href=\"./?q=siteusers&suid=\',site_users.id,\'\" target=\"photobank_users\" style=\"color: #fe0000;\">\',site_users.name,\' (\',site_users.organization,\')\',\'</a>\')\r\n                      END\r\n                 AS site_user_link,\r\n	DATE(concat(year(site_users_actions.modification_time),\'.\',month(site_users_actions.modification_time),\'.\',day(site_users_actions.modification_time))) as date_grouped\r\nFROM\r\n	site_users_actions\r\n	Inner Join site_actions ON site_actions.site_action_id = site_users_actions.id_action\r\n	Left Join site_users ON site_users.id NOT IN (2) AND site_users.id = site_users_actions.id_site_user\r\n	Inner Join _photobank_categories ON _photobank_categories.id = site_users_actions.action_value\r\nGROUP BY\r\n	site_actions.site_action_id,\r\n	site_actions.site_action_description,\r\n	site_user_link,\r\n	date_grouped\r\nORDER BY\r\n	date_grouped DESC,\r\n	the_number_of_visits DESC\r\nLIMIT 250',1,95,'Статистика посещений пользователей (группировка по дням)'),
 (10,'select\r\n		CONCAT(\'<a href=\"./?categid=\',ifnull(cast(c.id as char),\'\'),\'\" target=\"_personastarsCategories\">[\',ifnull(cast(c.id as char),\'\'),\'] \',ifnull(c2.description,\'-\'),\' &#187; \',ifnull(c.description,\'-\'),\'</a>\') as categoryLink\r\n		,a._count\r\n	from\r\n		(\r\n			select \r\n					description,count(id) as _count\r\n				from _photobank_categories where _active=1\r\n				group by description\r\n				having count(id)>1\r\n		) a\r\n		inner join _photobank_categories c on a.description=c.description and c._active=1\r\n		inner join _photobank_categories c2 on c.id_upper=c2.id and c2._active=1\r\n--		inner join _photobank_categories c3 on c2.id_upper=c3.id and c3._active=1\r\norder by\r\n	c.description,\r\n	a._count desc,\r\n	c.modification_time',1,170,'Дубли'),
 (9,'SELECT\r\n	site_actions.site_action_id,\r\n	site_actions.site_action_description,\r\n                CASE IFNULL(site_users_actions.id_site_user,-1)\r\n                      WHEN -1 then\r\n                         CONCAT(\'<small style=\"\">\',site_users_actions.remote_addr,\'<br/><span style=\"color: #a8a8a8;\">[\',site_users_actions.http_user_agent,\']</span></small>\')\r\n                      ELSE\r\n                         concat(\'<a href=\"./?q=siteusers&suid=\',site_users.id,\'\" target=\"photobank_users\" style=\"color: #fe0000;\">[\',site_users.id,\'] \',site_users.name,\' (\',site_users.organization,\')\',\'</a>\')\r\n                      END\r\n                 AS site_user_link,\r\n	concat(\'<a href=\"./?categid=\',_photobank_categories.id,\'\" target=\"photobank_categories\">\',_photobank_categories.description,\'</a>\') as category_link,\r\n	DATE(concat(year(site_users_actions.modification_time),\'.\',month(site_users_actions.modification_time),\'.\',day(site_users_actions.modification_time))) as date_grouped\r\nFROM\r\n	site_users_actions\r\n	Inner Join site_actions ON site_users_actions.id_site_user NOT IN (2) AND site_actions.site_action_id = site_users_actions.id_action\r\n	Left Join site_users ON site_users.id = site_users_actions.id_site_user\r\n	Inner Join _photobank_categories ON _photobank_categories.id = site_users_actions.action_value\r\nGROUP BY\r\n	site_actions.site_action_id,\r\n	site_actions.site_action_description,\r\n	site_user_link,\r\n	category_link,\r\n	date_grouped\r\nORDER BY\r\n	date_grouped DESC,\r\n	site_user_link\r\nLIMIT 250',1,110,'Посещённые пользователями категории'),
 (11,'SELECT\r\n		c.id as \'id категории\',\r\n		count(f.id) as \'количество\',\r\n		concat(\'<a href=\"./?categid=\',cast(c.id as char),\'\" target=\"new\">\',ifnull(c2.description,\'\'),\' &#187; \',c.description,\'</a>\') as \'ссылка\'\r\n	FROM\r\n		_photobank_categories AS c\r\n		left Join _photobank_files AS f ON  c.id = f.id_category and f._active=1\r\n		left join _photobank_categories c2 on c.id_upper=c2.id and c2._active=1\r\n	WHERE\r\n		c._active =  1 \r\n		and c.id_category_type in (2,3)\r\n	GROUP BY\r\n		c.id,\r\n		c.description\r\n	HAVING\r\n		Count(f.id)   < 1\r\n',1,180,'Пустые или почти пустые категории'),
 (12,'select\r\n		t.id as transactionID,\r\n		c.id as clientID,\r\n		c.surname,\r\n		c.firstname,\r\n		count(f.id) totalNumberOfFiles,\r\n		count(case when (ft.is_shipped=1) then 1 else null end) sentFiles,\r\n		t.modification_time\r\n	from	_photobank_transactions t\r\n		left join _photobank_files_transactions ft on t.id=ft.id_transaction\r\n		left join _photobank_customers c on t.id_customer=c.id\r\n		left join _photobank_files f on f._active=1 and ft.id_file=f.id\r\n	group by\r\n		t.id,\r\n		c.id,\r\n		c.surname,\r\n		c.firstname\r\n	order by\r\n		t.modification_time desc\r\nlimit 250',1,270,'Заявки'),
 (13,'SELECT\r\n`_photobank_transactions`.`id` as \'ID транзакции\',\r\n/*`_photobank_customers`.`organization` as \'Организация\',*/\r\nif(`site_users`.`_active`=1,`site_users`.`sort_of_activity`,`_photobank_customers`.`organization`) \'Организация\',\r\n`_photobank_customers`.`address` as \'Адрес\',\r\n\r\nif(	`_photobank_transaction_magazine_properties`.`id_magazine_number` is null,\r\n	if(	`_photobank_transaction_magazine_properties`.`id_magazine_edition` is null,\r\n		`_photobank_transaction_magazine_properties`.`magazine_edition_miscInfo`,\r\n		`_photobank_magazine_edition`.`name`\r\n	)\r\n	,`_photobank_magazine_number`.`name`\r\n)\r\nas \'№ издания\',\r\n\r\n`_photobank_files`.`file_name` as \'№ фотографии\',\r\n`_photobank_categories`.`description` as \'Тема\',\r\n`_photobank_file_size`.`name` as \'Размер \',\r\n`_photobank_authors`.`surname` as \'Фотограф\'\r\nFROM\r\n`_photobank_transactions`\r\nInner Join `_photobank_customers` ON `_photobank_transactions`.`id_customer` = `_photobank_customers`.`id`\r\nInner Join `_photobank_files_transactions` ON `_photobank_files_transactions`.`id_transaction` = `_photobank_transactions`.`id`\r\nInner Join `_photobank_files` ON `_photobank_files`.`id` = `_photobank_files_transactions`.`id_file`\r\nInner Join `_photobank_transaction_magazine_properties` ON `_photobank_transaction_magazine_properties`.`id_transaction` = `_photobank_transactions`.`id`\r\nInner Join `_photobank_file_size` ON `_photobank_file_size`.`id` = `_photobank_files_transactions`.`id_size`\r\nLeft Join `_photobank_categories` ON `_photobank_categories`.`id` = `_photobank_files`.`id_category`\r\nLeft Join `_photobank_magazine_edition` ON `_photobank_magazine_edition`.`id` = `_photobank_transaction_magazine_properties`.`id_magazine_edition`\r\nLeft Join `_photobank_magazine_number` ON `_photobank_magazine_number`.`id` = `_photobank_transaction_magazine_properties`.`id_magazine_number`\r\nLeft Join `_photobank_authors` ON `_photobank_files`.`file_name` LIKE concat(\'%\\_\',`_photobank_authors`.`personal_number`,\'\\.___\')\r\nLeft Join `site_users` ON `_photobank_customers`.`id_site_user`=`site_users`.`id`\r\nWHERE `_photobank_files_transactions`.`is_shipped`=0\r\nORDER BY\r\n`_photobank_transactions`.`id` DESC\r\n',1,250,'Заявки: открытые'),
 (14,'SELECT\r\n`_photobank_transactions`.`id` as \'ID транзакции\',\r\n/*`_photobank_customers`.`organization` as \'Организация\',*/\r\nif(`site_users`.`_active`=1,`site_users`.`sort_of_activity`,`_photobank_customers`.`organization`) \'Организация\',\r\n`_photobank_customers`.`address` as \'Адрес\',\r\n\r\nif(	`_photobank_transaction_magazine_properties`.`id_magazine_number` is null,\r\n	if(	`_photobank_transaction_magazine_properties`.`id_magazine_edition` is null,\r\n		`_photobank_transaction_magazine_properties`.`magazine_edition_miscInfo`,\r\n		`_photobank_magazine_edition`.`name`\r\n	)\r\n	,`_photobank_magazine_number`.`name`\r\n)\r\nas \'№ издания\',\r\n\r\n`_photobank_files`.`file_name` as \'№ фотографии\',\r\n`_photobank_categories`.`description` as \'Тема\',\r\n`_photobank_file_size`.`name` as \'Размер \',\r\n`_photobank_authors`.`surname` as \'Фотограф\',\r\nif(`_photobank_files_transactions`.`is_shipped`,\'Отправлена\',\'Ожидает отправки\') as \'Состояние\'\r\nFROM\r\n`_photobank_transactions`\r\nInner Join `_photobank_customers` ON `_photobank_transactions`.`id_customer` = `_photobank_customers`.`id`\r\nInner Join `_photobank_files_transactions` ON `_photobank_files_transactions`.`id_transaction` = `_photobank_transactions`.`id`\r\nInner Join `_photobank_files` ON `_photobank_files`.`id` = `_photobank_files_transactions`.`id_file`\r\nInner Join `_photobank_transaction_magazine_properties` ON `_photobank_transaction_magazine_properties`.`id_transaction` = `_photobank_transactions`.`id`\r\nInner Join `_photobank_file_size` ON `_photobank_file_size`.`id` = `_photobank_files_transactions`.`id_size`\r\nLeft Join `_photobank_categories` ON `_photobank_categories`.`id` = `_photobank_files`.`id_category`\r\nLeft Join `_photobank_magazine_edition` ON `_photobank_magazine_edition`.`id` = `_photobank_transaction_magazine_properties`.`id_magazine_edition`\r\nLeft Join `_photobank_magazine_number` ON `_photobank_magazine_number`.`id` = `_photobank_transaction_magazine_properties`.`id_magazine_number`\r\nLeft Join `_photobank_authors` ON `_photobank_files`.`file_name` LIKE concat(\'%\\_\',`_photobank_authors`.`personal_number`,\'\\.___\')\r\nLeft Join `site_users` ON `_photobank_customers`.`id_site_user`=`site_users`.`id`\r\nWHERE\r\n`_photobank_transactions`.`modification_time` between\r\ndate(	date_format(	adddate(	now(),\r\n							-1*dayofweek(now())+2\r\n						)\r\n						,\'%Y-%m-%d\'\r\n				)\r\n	)\r\nand now()\r\nORDER BY\r\n`_photobank_transactions`.`id` DESC\r\n',1,260,'Заявки: все за текущую неделю'),
 (15,'select 1 as \'1\'',1,11112,'werwerwer'),
 (16,'select\r\n@rownum:=@rownum+1 as \'rank\',\r\n	c.description as category_description,\r\n	f.file_name,\r\n	f.modification_time\r\nfrom _photobank_files f,\r\n       _photobank_categories c,\r\n       (select @rownum:=0) r\r\nwhere\r\n f.id_category=c.id and\r\n f.modification_time between \'2009-10-28 00:00\' and \'2009-10-29 00:00\'\r\nand f.id_category > 0',1,280,'Изменённые файлы'),
 (17,'SELECT\r\n  modification_time as ModificationTime,\r\n  id_photobank_news as NewsID,\r\n  `title` as NewsTitle,\r\n  \'\' as NewCategoryID\r\nFROM _photobank_news p\r\nwhere _active=1\r\norder by id_photobank_news desc;',1,290,'Новости - обновление категорий - 17596-Russian, 16845-Foreign, 16846-Studio'),
 (18,'select distinct su.name,\r\nsua.remote_addr, sua.http_user_agent\r\n\r\nfrom site_users_actions sua\r\ninner join site_users su on sua.id_site_user = su.id\r\nwhere sua.modification_time > \'2010-01-10\'\r\norder by sua.remote_addr',1,55555,'Пользователи, удачно залогинившиеся с определённого числа');
